import React, { Component } from 'react';
import ProjectCard from "./css/ProjectCard";
import "./css/styles.css";
import "./css/w3schools.css";
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';



export default class Projects extends Component {
  render() {
    return (
      <div id="projects">
      <h3 class="main montserrat large"> PROJECTS </h3>
      <div class="main">
        <ProjectCard title='CovEducation' paragraph='Worked part-time on a volunteer web development team to build a new website using React.js for CovEducation, a non-profit continuing K-12 education in the US during the COVID-19 outbreak.'/>
        <ProjectCard title='BotBegone' paragraph='Worked with two other students to create a website that gamifies Twitter bothunting. Users can submit links to Twitter accounts and a neural network will determine whether the account is a human or botnet based on a variety of factors including follower count and followee count. Links can also be reported to WHOOOO. Users compete to identify the most botnets and earn badges. I WAS IN CHARGE HAKDF:L.'/>
        <ProjectCard title='World War II Oral Histories' paragraph='Created website to preserve World War II Oral Histories collected for Girl Scout Gold Award Project.'/>
        <ProjectCard title='Immigration Nation' paragraph='Worked with 3 other people to create a website that facilitates access to resources including English classes, restaurants, and cultural centers for immigrants in the Greater New York City Area.'/>
        <ProjectCard title='“Adaptive Feedback Protocol for Underwater Vehicles via Software-Defined Acoustic Modems”' paragraph='Worked with 4 other students to research WHAT????'/>
    </div>
    </div>

    )
  }
}
